CREATE OR ALTER PROCEDURE [dbo].[Report_justificaciones_pendientes_apv]
@idPassport nvarchar(100) = '1',
@IDEmployee nvarchar(max) = '0',
@FechaInicio datetime2 = '20210301',
@FechaFin datetime2 = '20210301',
@IDUserField nvarchar(100) = '0'
AS
select queryReport.*,[dbo].[GetFeatureNextLevelPassportsByEmployee](queryReport.CodEmpleado,'Calendar.JustifyIncidences',2) AS Supervisor
from(
SELECT 
EG.GroupName as Departamento,
DC.IDEmployee AS CodEmpleado,
E.Name As ApellidoNombre,
DC.Date AS Fecha,
DID.Description AS Ausencia,
RT.Type AS Motivo,
RT.IdType as IDMotivo,
R.Status as EstadoSolicitud,
'' AS DocEstado
FROM DailyCauses AS DC
inner join (select * from splitMAX(@IDEmployee,',')) tmp on DC.IDEmployee = tmp.Value
INNER JOIN  Employees AS E ON E.ID=DC.IDEmployee
INNER JOIN sysroPassports sp ON sp.IDEmployee=E.ID
INNER JOIN sysrovwAllEmployeeGroups on sysrovwAllEmployeeGroups.IDEmployee = DC.IDEmployee
INNER JOIN  sysroEmployeeGroups AS EG ON EG.IDEmployee=DC.IDEmployee and DC.Date between eg.BeginDate and eg.EndDate
INNER JOIN  DailyIncidences AS DI ON DC.IDEmployee=DI.IDEmployee AND DC.Date=DI.Date AND DC.IDRelatedIncidence=DI.ID
INNER JOIN sysroDailyIncidencesTypes AS DIT ON DIT.ID=DI.IDType
INNER JOIN sysroDailyIncidencesDescription AS DID ON DID.IDIncidence=DI.IDType
LEFT JOIN Requests AS R ON DC.date between R.date1 and isnull(R.date2, R.date1) AND R.IDEmployee=DC.IDEmployee
LEFT JOIN sysroRequestType AS RT ON R.RequestType=RT.IdType 
LEFT JOIN Causes AS C ON C.ID=R.IDCause
inner join sysrovwSecurity_PermissionOverEmployees poe on poe.IdEmployee = DC.IDEmployee and DC.Date between poe.BeginDate and poe.EndDate and poe.IdPassport = @idPassport
left join EmployeeUserFieldValues with (nolock) on EmployeeUserFieldValues.IDEmployee = E.ID and EmployeeUserFieldValues.FieldName = (select FieldName from sysroUserFields Where ID = @IDUserField) and (EmployeeUserFieldValues.date >= getDate() or EmployeeUserFieldValues.date = '1900-01-01 00:00:00')
where 
DC.IDCause=0 AND 
DC.Date between cast(@FechaInicio as date) AND cast(@FechaFin as date)
 
union
 
SELECT
EG.GroupName as Departamento,
DC.IDEmployee AS CodEmpleado,
E.Name As ApellidoNombre,
fc.DueDate AS Fecha,
'' AS Ausencia,
C.Name AS Motivo,
-1 as IDMotivo,
'' AS EstadoSolicitud,
CASE  
     WHEN fc.docid is null THEN 
		CASE  
			 WHEN exists(select top 1 tmpDoc.Status from documents tmpDoc where (tmpDoc.IdHoursAbsence = fc.forecastId or tmpDoc.IdDaysAbsence = fc.forecastId)) THEN 'Rechazado'
			 ELSE 'Pendiente de entregar'
		END  
     ELSE 'Pte de validación'
END  AS DocEstado
FROM DailyCauses AS DC
inner join (select * from splitMAX(@IDEmployee,',')) tmp on DC.IDEmployee = tmp.Value
INNER JOIN  Employees AS E ON E.ID=DC.IDEmployee
INNER JOIN sysroPassports sp ON sp.IDEmployee=E.ID
INNER JOIN sysrovwAllEmployeeGroups on sysrovwAllEmployeeGroups.IDEmployee = DC.IDEmployee
INNER JOIN  sysroEmployeeGroups AS EG ON EG.IDEmployee=DC.IDEmployee and DC.Date between eg.BeginDate and eg.EndDate
INNER JOIN sysrovwForecastDocumentsFaults fc on dc.Date between fc.begindate and isnull(fc.enddate, fc.begindate) and fc.DueDate >= dc.Date and fc.idemp = dc.IDEmployee
LEFT JOIN Causes AS C ON C.ID=fc.IDCause
inner join sysrovwSecurity_PermissionOverEmployees poe on poe.IdEmployee = DC.IDEmployee and DC.Date between poe.BeginDate and poe.EndDate and poe.IdPassport = @idPassport
left join EmployeeUserFieldValues with (nolock) on EmployeeUserFieldValues.IDEmployee = E.ID and EmployeeUserFieldValues.FieldName = (select FieldName from sysroUserFields Where ID = @IDUserField) and (EmployeeUserFieldValues.date >= getDate() or EmployeeUserFieldValues.date = '1900-01-01 00:00:00')
WHERE 
DC.IDCause<>0 AND 
DC.Date between cast(@FechaInicio as date) AND cast(@FechaFin as date)
group by EG.GroupName,DC.IDEmployee,E.Name,fc.DueDate,C.Name, fc.docid, fc.forecastId
 
 
UNION
 
SELECT
EG.GroupName as Departamento,
ID.IDEmployee AS CodEmpleado,
E.Name As ApellidoNombre,
ID.Date AS Fecha,
'Fichajes Impares' AS Ausencia,
NULL AS Motivo,
-1 as IDMotivo,
NULL AS EstadoSolicitud,
'' AS DocEstado
FROM sysrovwIncompletedDays AS ID
inner join (select * from splitMAX(@IDEmployee,',')) tmp on ID.IDEmployee = tmp.Value
INNER JOIN  Employees AS E ON E.ID=ID.IDEmployee
INNER JOIN sysroPassports sp ON sp.IDEmployee=E.ID
INNER JOIN sysrovwAllEmployeeGroups on sysrovwAllEmployeeGroups.IDEmployee = ID.IDEmployee
INNER JOIN  sysroEmployeeGroups AS EG ON EG.IDEmployee=ID.IDEmployee and ID.Date between eg.BeginDate and eg.EndDate
inner join sysrovwSecurity_PermissionOverEmployees poe on poe.IdEmployee = ID.IDEmployee and ID.Date between poe.BeginDate and poe.EndDate and poe.IdPassport = @idPassport
left join EmployeeUserFieldValues with (nolock) on EmployeeUserFieldValues.IDEmployee = E.ID and EmployeeUserFieldValues.FieldName = (select FieldName from sysroUserFields Where ID = @IDUserField) and (EmployeeUserFieldValues.date >= getDate() or EmployeeUserFieldValues.date = '1900-01-01 00:00:00')
WHERE 
ID.Date between cast(@FechaInicio as date) AND cast(@FechaFin as date)
group by EG.GroupName,ID.IDEmployee,E.Name,ID.Date
 
)queryReport
GO

